import Paciente from "./Paciente"

const ListadoPacientes = ({pacientes, setPaciente, eliminarPaciente}) => {
    return (
        <div className=" bg-gray-300 p-4 md:w-1/6 lg:w-3/4 md:h-screen mx-64 overflow-y-scroll uppercase ">

            {pacientes && pacientes.length ? (
                <>
                    <h2 className="font-black text-3xl text-center">Listado Alumnos</h2>


                    { pacientes.map( paciente => (
                        <Paciente 
                            key={paciente.id}
                            paciente={paciente}
                            setPaciente={setPaciente}
                            eliminarPaciente={eliminarPaciente}
                        />
                    ))}

                </>

            ) : (
                <>

                    <p className="font-black text-3xl text-centerr">
                        Comienza agregando pacientes {''}
                        <span className="font-black text-3xl text-center ">y aparecer√°n en este lugar</span>
                    </p>
                </>
            )}
        </div>
    )
}

export default ListadoPacientes
